import React, { Component } from 'react';
import  Pagination  from 'react-bootstrap/pagination';

class Footer extends Component{
    state={};

    render(){
        const {pageVied,newMovies,activeChange, activePage}=this.props;
        let pagNum = [];

        for (
        let num = 1;
        num <= Math.ceil(newMovies.length/pageVied);
        num++
    ) {
        console.log(num);
        pagNum.push(
        <Pagination.Item key={num} onClick={() => activeChange(num)}>
          {num}
        </Pagination.Item>
      );
    }
    return <div><Pagination>{pagNum}</Pagination></div>
    }
}  

export default Footer;
